import React from 'react';

function TechData(props) {
  return (
      <div className="tech-data">
	      	{props.techGroup}
	      	<ul>
	      		<li> Symfony </li>
	      		<li> ReactJS </li>
	      		<li> CodeIgniter </li>

            {props.techItems.map((value, index) => {
                return <li>{value}</li>
            })}
	      	</ul>
      </div>
  );
}

export default TechData;
